import React, { useRef, useState } from 'react';
import './BG.css';
import axios from 'axios';

export default function VideoEditor() {
  const inputRef = useRef();
  const [videoFile, setVideoFile] = useState(null);
  const [videoPreview, setVideoPreview] = useState(null);
  const [outputVideo, setOutputVideo] = useState(null);
  const [loading, setLoading] = useState(false);
  const [operation, setOperation] = useState("remove_bg");
  const [startTime, setStartTime] = useState("0");
  const [endTime, setEndTime] = useState("5");
  const [effect, setEffect] = useState("none");

  const handleUpload = (e) => {
    const file = e.target.files[0];
    if (file && file.type.startsWith("video/")) {
      setVideoFile(file);
      setVideoPreview(URL.createObjectURL(file));
      setOutputVideo(null);
    }
  };

  const handleProcessVideo = async () => {
    if (!videoFile) return;

    setLoading(true);
    const formData = new FormData();
    formData.append("video", videoFile);
    formData.append("operation", operation);
    formData.append("start_time", startTime);
    formData.append("end_time", endTime);
    formData.append("effect", effect);

    try {
      const res = await axios.post("http://localhost:8000/process", formData, {
        headers: { "Content-Type": "multipart/form-data" },
        responseType: "blob"
      });

      const blob = new Blob([res.data], { type: "video/mp4" });
      setOutputVideo(URL.createObjectURL(blob));
    } catch (err) {
      console.error(err);
      alert("Processing failed");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="BG">
      <div className="SideBar">
        <ul>
          <li onClick={() => inputRef.current.click()}>Upload</li>
          <li onClick={handleProcessVideo}>Process</li>
        </ul>
        <select onChange={(e) => setOperation(e.target.value)} value={operation}>
          <option value="remove_bg">Remove Background</option>
          <option value="clip">Clip</option>
          <option value="crop">Crop</option>
          <option value="effect">Effect</option>
        </select>

        {operation === "clip" && (
          <div>
            <input type="text" placeholder="Start time (sec)" value={startTime} onChange={(e) => setStartTime(e.target.value)} />
            <input type="text" placeholder="End time (sec)" value={endTime} onChange={(e) => setEndTime(e.target.value)} />
          </div>
        )}

        {operation === "effect" && (
          <select onChange={(e) => setEffect(e.target.value)} value={effect}>
            <option value="none">None</option>
            <option value="grayscale">Grayscale</option>
            <option value="invert">Invert</option>
            <option value="blur">Blur</option>
          </select>
        )}
      </div>

      <div className="BodyBar">
        <div className="UploadBox" onClick={() => inputRef.current.click()}>
          <input
            ref={inputRef}
            type="file"
            accept="video/*"
            style={{ display: "none" }}
            onChange={handleUpload}
          />
          {videoPreview ? (
            <video src={videoPreview} controls />
          ) : (
            <p>Click to upload a video</p>
          )}
        </div>

        {loading && <p style={{ color: "white" }}>Processing video...</p>}

        {outputVideo && (
          <div className="OutputBox">
            <h4>Processed Video:</h4>
            <video src={outputVideo} controls />
            <a href={outputVideo} download="processed.mp4">
              <button>Download Video</button>
            </a>
          </div>
        )}
      </div>
    </div>
  );
}
